import React from 'react';
import User from './User';

const UsersList = (props) => {
  return (
    <div>
      {props.users.map((user, index) => (
        <User
          key={index}
          username={user.username}
          age={user.age}
          img={user.img}
          major={user.major}
        />
      ))}
    </div>
  );
};

export default UsersList;
